import React from 'react';
import PopupWithForm from './PopupWithForm';
import registerok from '../images/registered.png';
import registererror from '../images/error.png';

export default function InfoToolTip({ isOpen, onClose, status }) {
  <PopupWithForm
    isOpen={isOpen}
    name={'register'}
    content={'register'}
    onClose={onClose}
  >
    <img src={status ? registerok : registererror} alt="status" />
    <p className="popup_register-title">
      {status
        ? '¡Correcto! Ya estás registrado.'
        : 'Uy, algo salió mal. Por favor, inténtalo de nuevo.'}
    </p>
  </PopupWithForm>;
}

